                    <div class=""modal-body"">
                        <b>Intro:</b> There are three primary factors to bear in mind while testing this system-<br />
                        1. The model is not designed to make predictions more than approximately 18 months from the end of the training data (July 2018");
                WriteLiteral(@"), nor would it be prudent to do so. Consequently, only 2019 and 2020 are available as prediction options.<br />
